import Inputfield from "../Inputfield/Inputfield";
const form_field =[
    {
     type:"text",
     id:"userid",
     class:"form-field",
     placeholder:"Email or phone number"

    },
    {
        type:"password",
        id:"password",
        class:"form-field",
        placeholder:"Password"
        
    },
    {
     type:"submit",
     id:"submit",
     class:"btn btn-primary",
     value:'Log in'
}
]
const Form =()=>{
    return (
    <form className="d-flex justify-content-center bg-danger">
        <div class="form-group">
          {
            form_field.map((element,key)=>{
                return <Inputfield type={element.type} placeholder={element.placeholder} />
            })
          }
        </div>
         
      </form>
    )
}
export default Form ;
